import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import { Button, Typography, Card, CardContent, CardMedia, Dialog, DialogContent, DialogTitle, TextField, DialogActions, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#f5f5f5',
    minHeight: '100vh',
    paddingTop: theme.spacing(4),
  },
  gridContainer: {
    width: '100%',
    maxWidth: '1200px',
    margin: '0 auto',
    padding: theme.spacing(2),
  },
  card: {
    maxWidth: 345,
    margin: theme.spacing(2),
  },
  media: {
    height: 140,
  },
}));

// Component to handle adding a new campus with a popup form
const AddCampusForm = ({ open, handleClose, onSubmit }) => {
  const [formData, setFormData] = useState({
    name: '',
    address: '',
    description: '',
    imageUrl: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
    handleClose();
  };

  return (
    <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
      <DialogTitle id="form-dialog-title">Add New Campus</DialogTitle>
      <DialogContent>
        <TextField
          autoFocus
          margin="dense"
          id="name"
          name="name"
          label="Campus Name"
          type="text"
          fullWidth
          value={formData.name}
          onChange={handleChange}
        />
        <TextField
          margin="dense"
          id="address"
          name="address"
          label="Address"
          type="text"
          fullWidth
          value={formData.address}
          onChange={handleChange}
        />
        <TextField
          margin="dense"
          id="description"
          name="description"
          label="Description"
          type="text"
          fullWidth
          value={formData.description}
          onChange={handleChange}
        />
        <TextField
          margin="dense"
          id="imageUrl"
          name="imageUrl"
          label="Image URL"
          type="text"
          fullWidth
          value={formData.imageUrl}
          onChange={handleChange}
        />
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} color="primary">
          Cancel
        </Button>
        <Button onClick={handleSubmit} color="primary">
          Submit
        </Button>
      </DialogActions>
    </Dialog>
  );
};

const AllCampusesView = ({ allCampuses }) => {
  const classes = useStyles();
  const [openAddModal, setOpenAddModal] = useState(false);

  const handleOpenAddModal = () => setOpenAddModal(true);
  const handleCloseAddModal = () => setOpenAddModal(false);

  const handleAddCampus = (campusData) => {
    // Add logic to submit campusData to server
    console.log('Submitting new campus:', campusData);
    // Simulate API response
    setTimeout(() => window.location.reload(), 500); // Reload after fake delay
  };

  return (
    <div className={classes.root}>
      <Button variant="contained" color="primary" onClick={handleOpenAddModal}>
        Add New Campus
      </Button>
      <Grid container spacing={3} className={classes.gridContainer}>
        {allCampuses.map(campus => (
          <Grid item xs={12} sm={6} md={4} key={campus.id}>
            <Card className={classes.card}>
              <CardMedia
                className={classes.media}
                image={campus.imageUrl || 'https://placekitten.com/200/140'}
                title={campus.name}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  {campus.name}
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                  {campus.description}
                </Typography>
                <Button size="small" color="primary">
                  Learn More
                </Button>
                <Button size="small" color="primary">
                  Edit
                </Button>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
      <AddCampusForm open={openAddModal} handleClose={handleCloseAddModal} onSubmit={handleAddCampus} />
    </div>
  );
};

AllCampusesView.propTypes = {
  allCampuses: PropTypes.array.isRequired,
};

export default AllCampusesView;
